import React from 'react';

import { BsFillShieldLockFill } from 'react-icons/bs';
import { IoIosOptions } from 'react-icons/io';
import { AiOutlineCloudUpload } from 'react-icons/ai';
import { BiSupport, BiDollar } from 'react-icons/bi';
import { GrHostMaintenance } from 'react-icons/gr';


const iconStyle = (Icon) => <Icon size="3rem" color="#0f0f0f" />;

export const featuresData = [
	{
		name: 'ADVISORY',
		description: 'ADVISORY - having or consisting in the power to make recommendations but not to take action enforcing them:',
		icon: BsFillShieldLockFill,
		imgClass: 'one',
	},
	{
		name: 'AUDIT & ASSURANCE',
		description: 'AUDIT & ASSURANCE - description',
		icon: iconStyle(IoIosOptions),
		imgClass: 'two',
	},
	{
		name: 'DUE DILIGENCE',
		description: 'DUE DILIGENCE- desription',
		icon: iconStyle(GrHostMaintenance),
		imgClass: 'three',
	},
	{
		name: 'FORENSIC INVESTIGATION',
		description: 'FORENSIC INVESTIGATION - description',
		icon: iconStyle(BiSupport),
		imgClass: 'four',
	},
	{
		name: 'FRAUD RISK ASSESSMENT',
		description: 'FRAUD RISK ASSESSMENT - description',
		icon: iconStyle(BiDollar),
		imgClass: 'five',
	},
	{
		name: 'GOODS AND SERVICES TAX',
		description: 'GOODS AND SERVICES TAX - description',
		icon: iconStyle(AiOutlineCloudUpload),
		imgClass: 'six',
	},
	{
		name: 'INTERNAL AUDIT',
		description: 'INTERNAL AUDIT - description',
		icon: iconStyle(AiOutlineCloudUpload),
		imgClass: 'six',
	},
	{
		name: 'TAXATION',
		description: 'TAXATION - description',
		icon: iconStyle(AiOutlineCloudUpload),
		imgClass: 'six',
	},
	{
		name: 'VALUATION',
		description: 'VALUATION - description',
		icon: iconStyle(AiOutlineCloudUpload),
		imgClass: 'six',
	}
];
